  `id` bigint NOT NULL AUTO_INCREMENT,
  `name` varchar(150) NOT NULL,
  `jobRole` varchar(150) NOT NULL,
  `jobDescription` text,
  `ctc` bigint unsigned NOT NULL,
  `minCgpaRequired` float DEFAULT NULL,
  `jobLocation` varchar(200) DEFAULT NULL,
  `jobRequirements` json DEFAULT NULL,
  `hiringStatus` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
