INSERT INTO `recruiter` VALUES (9,'Google Inc','SDE','Google\'s software engineers develop the next-generation technologies that change how billions of users connect, explore, and interact with information and one another. Our products need to handle information at massive scale, and extend well beyond web search. We\'re looking for engineers who bring fresh ideas from all areas, including information retrieval, distributed computing, large-scale system design, networking and data storage, security, artificial intelligence, natural language processing, UI design and mobile; the list goes on and is growing every day. As a software engineer, you will work on a specific project critical to Google’s needs with opportunities to switch teams and projects as you and our fast-paced business grow and evolve. We need our engineers to be versatile, display leadership qualities and be enthusiastic to take on new problems across the full-stack as we continue to push technology forward.\n\n                With your technical expertise you will manage project priorities, deadlines, and deliverables. You will design, develop, test, deploy, maintain, and enhance software solutions.\n                \n                Google Cloud accelerates organizations’ ability to digitally transform their business with the best infrastructure, platform, industry solutions and expertise. We deliver enterprise-grade solutions that leverage Google’s cutting-edge technology – all on the cleanest cloud in the industry. Customers in more than 200 countries and territories turn to Google Cloud as their trusted partner to enable growth and solve their most critical business problems',4500000,8,'Bangalore','[\"Write and test product or system development code\", \"Participate in, or lead design reviews with peers and stakeholders to decide amongst available technologies\", \"Review code developed by other developers and provide feedback to ensure best practices (e.g., style guidelines, checking code in, accuracy, testability, and efficiency\", \"Contribute to existing documentation or educational content and adapt content based on product/program updates and user feedback\", \"Triage product or system issues and debug/track/resolve by analyzing the sources of issues and the impact on hardware, network, or service operations and quality\"]',1),(10,'Oracle','Application Engineer','Remote work employees may be required to be present at the closest designated Arrow office for work-related purposes, at the company’s request and sole discretion.\n\nArrow Electronics, Inc. – a Fortune 150 company with global headquarters in Denver - helps the world’s best technology companies think “Five Years Out,” working together to continually innovate the “next big thing”. We are a global provider of technology products, services and solutions, with 2020 sales of over $30 billion.\n\nArrow has an excellent opportunity for an Oracle Manufacturing Application Engineer. We are looking for a talented Oracle techno-functional professional with supply chain functional knowledge to join our team and play an integral role in the development and support of enterprise level applications. You must be a self-starter and comfortable in a fast-paced environment. You will be asked to work on a wide variety of tasks from 100% new development to bug fixes and maintenance. This includes working with the business and the technology areas to understand requirements for IT development and support.',3200000,7.5,'Hyderabad','[\"Advanced knowledge and Demonstrated experience in the implementation and support of Oracle technologies including SQL, PL/SQL, SQL performance tuning , Oracle workflow, Oracle Applications Framework (OAF), XML Publisher, Forms & Reports.\", \"Good knowledge in underlying ERP applications and database architecture\", \"Must possess strong skills in developing Interfaces, Reports and Extensions and customization utilizing Oracle best practice methodology\", \"Knowledge of B2B processes, interfaces and good understanding of the integration of various modules with other EBS modules\", \"Ability to plan and organize work in a fast-paced environment coordinating with internal customers to help support and enhance business systems.\"]',1),(11,'Microsoft','Software Engineer - II','Do you enjoy the thrill and energy of a startup coupled with engineering rigor? Would you like to be part of an agile, learning, empowered, energetic and collaborative team? Do you believe in clean design, crafted implementation, being meticulous about quality, obsessing about the customer and innovating daily? The extensive reach of Edge coupled with building delightful everyday experiences on a range of devices offers exceptional opportunities of independent ownership, working on cutting edge technologies and professional growth. \n\n \n\nCome join a team of highly motivated developers working on Microsoft Edge!   We are looking for an individual with high standards of excellence to join our engineering team to build amazing experiences that are robust, fast and seamless. The ideal candidate is skilled at design and implementation, and able to and own architectural designs and collaborate well across multiple partner teams. \n\n',4000000,7.5,'Hyderabad, Telengana','[\"Skilled at design and implementation with a focus on quality \", \"Create layered, componentized, testable, interface-based designs \", \"Robust implementation and crafted end-user experiences \", \"Design highly performant, highly usable, scalable, world-ready, accessible software\", \"Collaborate across functional and partner teams to define requirements \"]',1),(12,'Siemens','Software Engineer','Board bring-up and porting Linux/QNX BSP for new hardware platforms\nDesign/develop/customize/integrate/configure/fix-issues in C++ middleware components/applications for Linux/QNX-based Automotive platforms\nIntegrate/configure/fix-issues in Linux Userland packages\nCustomize/configure/fix-issues in Linux/QNX kernel modules/features\nWorking and coordinating with teams located across geographies, interacting with customers',1000001,6.5,'Noida','[\"Expertise in Linux/QNX BSP development, board bring-up, porting, customization\", \"Proficient in both C and C++ programming and object-oriented design concepts\", \"Good work experience in multi-threaded application development\", \"Experience in Linux build systems like Yocto\", \"Ability to work in a challenging environment, guide team members, good customer communication skills\", \"Experience in scripting languages like python, shell scripting\", \"Good work experience in multi-threaded application development\"]',1);
/*!40000 ALTER TABLE `recruiter` ENABLE KEYS */;
